        return JPoint(x, y, z);
    }

    function _jPointDouble(
        JPoint memory p
    ) internal pure returns (JPoint memory) {
        uint x;
        uint y;
        uint z;
        (x, y, z) = _modifiedJacobianDouble(p.x, p.y, p.z);
        return JPoint(x, y, z);
    }

